			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#!/bin/sh\n#要build的target名\n\nTARGET_NAME='BTBaseSDK'\nUI_TARGET_NAME='BTBaseSDKUI'\n\n#OBJROOT=\"${OBJROOT}\" #xcode 10以下版本使用\nOBJROOT=\"${OBJROOT}/DependentBuilds\" #xcode 10以上版本使用\n\n#要合并的framework\nMERGE_FRAMEWORKS=(\n\"${TARGET_NAME}.framework\"\n)\n\n#要拷贝的资源\nCOPY_TARGETS=(\n\"${UI_TARGET_NAME}.bundle\"\n)\n\nUNIVERSAL_OUTPUT_FOLDER=\"${SRCROOT}/Release/\"\n\n#创建输出目录，并删除之前发布的文件\nrm -rf \"${UNIVERSAL_OUTPUT_FOLDER}\"\nmkdir -p \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\n#分别编译模拟器和真机的Framework\necho 'start build iphoneos'\nxcodebuild -workspace \"iOSSDK.xcworkspace\" -scheme \"${TARGET_NAME}\" -sdk iphoneos OBJROOT=\"${OBJROOT}\" build\necho 'build iphoneos finished'\n\necho 'start build iphonesimulator'\nxcodebuild -workspace \"iOSSDK.xcworkspace\" -scheme \"${TARGET_NAME}\" -sdk iphonesimulator OBJROOT=\"${OBJROOT}\" build\necho 'build iphoneos finished'\n\n#编译SDK UI\n#直接添加UI Target到PublishBTBaseSDK的Scheme里，需要放在本命令文本执行前\n\n# 循环合并frameworks\nfor item in ${MERGE_FRAMEWORKS[@]};do\n\n#删除路径里的文件夹\nfwk_name=${item}\n#删除路径里的.framework\nbin_name=${fwk_name%*.framework}\n\necho ${fwk_name}\necho ${bin_name}\n\n#拷贝framework到output目录\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${item}\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${item}\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\n\n#合并framework，输出最终的framework到build目录\ntarget_path=\"${UNIVERSAL_OUTPUT_FOLDER}${fwk_name}/${bin_name}\"\nfile0=\"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator/${item}/${bin_name}\"\nfile1=\"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${item}/${bin_name}\"\n\nlipo -create -output \"${target_path}\" \"${file0}\" \"${file1}\"\ndone\n\n\n#拷贝资源到output目录\nfor item in ${COPY_TARGETS[@]};do\ncp -R \"${BUILD_DIR}/${CONFIGURATION}-iphoneos/${item}\" \"${UNIVERSAL_OUTPUT_FOLDER}\"\ndone\n# 合并frameworks完成\n\n#删除编译之后生成的无关的配置文件\ndir_path=\"${UNIVERSAL_OUTPUT_FOLDER}${TARGET_NAME}.framework/\"\nfor file in ls $dir_path\ndo\nif [[ ${file} =~ \".xcconfig\" ]]\nthen\nrm -f \"${dir_path}/${file}\"\nfi\ndone\n#判断build文件夹是否存在，存在则删除\nif [ -d \"${SRCROOT}/build\" ]\nthen\nrm -rf \"${SRCROOT}/build\"\nfi\n#rm -rf \"${BUILD_DIR}/${CONFIGURATION}-iphonesimulator\" \"${BUILD_DIR}/${CONFIGURATION}-iphoneos\"\n#打开合并后的文件夹\nopen \"${UNIVERSAL_OUTPUT_FOLDER}\"\n";
